I saw a really good theory in Facebook;

"I believe what he means by it's time for the Jedi to end is that in order to prevail in the galaxy and restore peace, they must embrace both sides of the Force. Light and Dark must mingle in the galaxy as they do in every living being. The Sith shun the light, and believe their ability to kill, to make war, and to conquer makes them strong; they thrive off of their hatred, and relish in revenge. 

The Jedi attempt to subdue their anger, and bury it deep in their minds, and focus on being calm in the face of danger, kind, and empathetic. They fear attachment for it can spark jealously, and betrayal. However, the Jedi fail to see attachment can inspire greatness in all beings, even those with darker hearts. The key is responsibility, and balance, which is what I think Luke is teaching Rey on Ach-to. With moderation, and control, all emotions can benefit the being."
